export const Cell = ({ num, winner, cells, handleClick }) => {
  console.log(cells[num]);
  return (
    <td onClick={() => !winner && handleClick(num)} style={{ border: '1px solid grey', width: 100, height: 100 }}>
      {cells[num]}
    </td>
  );
};
